import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first product "Add to Cart" button (by text and class)
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });

    // Rapid Cart Manipulation Stress Test
    // 1. Add first product to cart 5 times rapidly
    for (let i = 0; i < 5; i++) {
      const addToCartBtns = await page.$$('.add-to-cart');
      if (addToCartBtns.length > 0) {
        await addToCartBtns[0].click();
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_5_times.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_5_times.png'));

    // 2. Open the cart (find .cart or Cart text, click to open modal)
    // Try to click the cart div (it may not be a button)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');
    // Wait for cart modal to appear (look for #cartModal or .cart-item)
    await page.waitForSelector('.cart-item, .empty-cart', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // 3. Rapidly increment and decrement quantity of the first cart item
    // Wait for quantity + and - buttons
    await page.waitForSelector('.quantity-btn', { timeout: 5000 });
    const plusBtns = await page.$$('.quantity-btn');
    // Click "+" 3 times
    for (let i = 0; i < 3; i++) {
      if (plusBtns.length > 1) {
        await plusBtns[1].click(); // [0] is "-", [1] is "+"
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_incremented.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_incremented.png'));

    // Click "-" 2 times
    for (let i = 0; i < 2; i++) {
      if (plusBtns.length > 0) {
        await plusBtns[0].click(); // [0] is "-"
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_decremented.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_decremented.png'));

    // 4. Remove the item from the cart
    // Wait for "Remove" button
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    const removeBtn = await page.$('.remove-item');
    if (removeBtn) {
      await removeBtn.click();
    }
    // Wait for cart to update (empty cart message)
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_removed.png'));

    // 5. Extract cart count from the cart icon (should be 0)
    let cartCount = null;
    try {
      await page.waitForSelector('.cart', { timeout: 5000 });
      const cartText = await page.$eval('.cart', el => el.textContent);
      const match = cartText.match(/\d+/);
      cartCount = match ? parseInt(match[0], 10) : null;
    } catch (e) {
      cartCount = null;
    }

    return {
      success: true,
      action: "Performed rapid cart add, quantity change, and removal to stress test cart logic",
      extractedData: {
        cartCountAfterRemoval: cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
